public boolean equals(Object obj) {
  if (this == obj) {
    return true;
  }
  if (obj == null) {
    return false;
  }
  if (getClass() != obj.getClass()) {
    return false;
  }
  TimelineFilterList other = (TimelineFilterList) obj;
  if (operator != other.operator) {
    return false;
  }
  if (filterList == null) {
    if (other.filterList != null) {
      return false;
    }
  } else if (!filterList.equals(other.filterList)) {
    return false;
  }
  return true;
}
